import React from 'react';

export default function MembersActive(props){

    let activeDuration=[];
    props.period.forEach((item,index)=>{
        activeDuration[index] = item;
        activeDuration[index].forEach((element,index)=>{
             let obj={
                 st_time: element.start_time,
                  end_time: element.end_time
             }
             console.log(obj);  
        }) 
        console.log(activeDuration); 
    })
    console.log(activeDuration);
    return(
        <section>
            <h3>{props.name}</h3>
            <p>Active Duration:</p>

            <button onClick={props.togglePopup}>CLOSE</button>
        </section>
    );
}
